      'event/EventHandler.tonyu': 'extends TObject;\nnative Tonyu;\n\nif (Tonyu.runMode) listeners=[];\n\n\\addListener(f) {\n    if (target && (typeof f)=="string") {\n        f=target[f];\n    }\n    if (typeof f!="function") throw new Error("Not a event listener: "+target+" / "+f);\n    listeners.push(f);\n    return {\n        remove: \\{\n           removeListener(f);\n        }\n    };\n}\n\\removeListener(f) {\n    var i=listeners.indexOf(f);\n    listeners.splice(i,1);\n}\n\\fire(args) {\n    if (released) return;\n    var t;\n    for (var h in listeners) {\n        if (h["fiber"]) {\n            t=Tonyu.thread();\n            h["fiber"].apply(target, [t].concat(args) );\n            t.steps();\n        } else {\n            h.apply(target,args);\n        }\n    }\n}\n\\release() {\n    released=true;\n}\n',
